import Dashboard from "./dashboard";
import Login from "./login";
import './App.css'

function App() {
  let username = "jeeva"
  let password = 'jeeva123'
  let isLogin = false
  if (isLogin) {
    return <Login />
  } else {
    return (<Dashboard username={username} password={password} />)
  }
}

export default App;
